(self.webpackChunkanomaly_new=self.webpackChunkanomaly_new||[]).push([[755],{3755:function(e,s,n){"use strict";n.r(s);var o=n(857),a=n(1880),r=n.n(a);s.default=(0,o.$2)(r())},1880:function(e){e.exports={charset:"utf-8",headers:{"Plural-Forms":"nplurals=2; plural=(n > 1);"},translations:{"":{"1000+ veteran care specialists (psychological, medical, social services)":{msgstr:["Plus de 1000 spécialistes en soins vétérans (psychologiques, médicaux, services sociaux)"]},"20,000+ members of underserved communities taught, including Ukrainian veterans and their children, IDPs, and Crimean Tatars. For children and teens, Anomaly provides and conversation clubs and civic engagement opportunities in addition to lessons. Through socially-engaged volunteering, young people learn that they can have a real impact on their neighbourhoods, cities, and country. ( add more general info); Link to English NOW (more detailed info on this page).":{msgstr:["Plus de 20 000 membres de communautés défavorisées ont bénéficié d'un enseignement, notamment des anciens combattants ukrainiens et leurs enfants, des personnes déplacées et des Tatars de Crimée. Pour les enfants et les adolescents, Anomaly fournit des clubs de conversation et des opportunités de participation civique en plus des leçons. Grâce à un bénévolat socialement engagé, les jeunes apprennent qu'ils peuvent avoir un impact réel sur leurs quartiers, leurs villes et leur pays. ( ajouter des informations plus générales) ; Lien vers l'anglais MAINTENANT (plus d'informations sur cette page)."]},"3500+ veterans in our community":{msgstr:["Plus de 3500 vétérans dans notre communauté"]},About:{msgstr:["À propos"]},"About Us":{msgstr:["À propos de nous"]},Address:{msgstr:["Adresse"]},Animals:{msgstr:["Animaux"]},"Anomaly connects foreign donors with an orphanage in Mariupol to help children find a new family and home.":{msgstr:["Anomalie relie les donateurs étrangers à un orphelinat à Mariupol pour aider les enfants à trouver une nouvelle famille et un nouveau foyer."]},"Anomaly has helped to organize 40 waste clean ups in neighborhoods all around Kyiv and 15 more around Ukraine. If you would like to host a local clean up- Anomaly can show you how!":{msgstr:["Anomaly a aidé à organiser 40 nettoyages dans les quartiers autour de Kiev et 15 autres dans toute l’Ukraine. Si vous souhaitez organiser un nettoyage local, Anomaly peut vous montrer comment faire !"]},"Anomaly helps adovcate the rights of children and promote better living quality for vulnerable children.":{msgstr:["Anomaly aide à défendre les droits des enfants et à promouvoir une meilleure qualité de vie des enfants vulnérables."]},"Anomaly helps the Ukrainian environment with neigborhood clean-ups and environmental advocacy projects. Anomaly hosts up to 3 cleans-ups a month to help minimize public litter. By doing so, Anomaly helps its participants learn about the effects of waste on the environment (both local and worldwide) and learn how to create similar projects at home. To add on, Anomaly helps to lobby environmental issues occuring in multiple cities across Ukraine. We will pinpoint any companies that are at the core of enironvmental issues and combat them through advocacy and lobbying.":{msgstr:["Anomaly aide l'environnement ukrainien dans les projets de nettoyage des quartiers et de défense de l'environnement, qui organisent jusqu'à 3 nettoyages par mois pour minimiser les déchets publiques. En faisant cela, Anomaly aide ses participants à se familiariser avec les effets des déchets sur l'environnement (local et mondial) et à apprendre comment créer des projets similaires à la maison. Pour ajouter ceci, Anomaly aide à faire pression sur les questions environnementales qui surviennent dans plusieurs villes d’Ukraine. Nous identifierons les entreprises qui sont au cœur des problèmes environnementaux et les combattrons par le biais de la sensibilisation et du lobbying."]},"Anomaly offers free english lessons and workshops on various topics. We offer these lessons to any adult in need to help promote personal sustainability and open their ability to work in future opportunities. If you are not a Veteran or Child, Anomaly can still help you with educational modules and workshops.":{msgstr:["Anomaly propose des cours d'anglais gratuits et des ateliers sur divers sujets. Nous offrons ces leçons à tout adulte dans le besoin afin de promouvoir la durabilité personnelle et d'ouvrir leur capacité à travailler dans des opportunités futures. Si vous n'êtes pas un Vétéran ou un Enfant, Anomaly peut tout de même vous aider avec des modules et des ateliers éducatifs."]},"Anomaly provides a wide range of volunteering opportunities in Ukraine. We have divisions in Kyiv, Lviv, Odessa and other Ukrainian cities. The main areas for volunteering are education, ecology, kids assistance, veterans programs, local communities, and animals protection. If you have skills in English teaching, IT, content creation, design, professional training, project management, you are the person we are looking for. If not, but you want to join us, feel free to apply and we will find volunteering opportunities within our team in accordance with your skills and desires. Do you have some ideas of how to improve Ukraine? Bring them to life together with us! Do you need immigration support for living in Ukraine? We provide it for all of our foreign volunteers. Still have questions? Don't hesitate, and fill out our appllication form. Let's talk about your future volunteering journey as a part of the Anomaly team!":{msgstr:["Nous avons des divisions à Kyiv, Lviv, Odessa et d'autres villes ukrainiennes. Les principaux domaines de bénévolat sont l’éducation, l’écologie, l’assistance aux enfants, les programmes d’anciens combattants, les communautés locales et la protection des animaux. Si vous avez des compétences en enseignement de l'anglais, en informatique, en création de contenu, en design, en formation professionnelle, en gestion de projet, vous êtes la personne que nous recherchons. Si ce n'est pas le cas, mais vous voulez nous rejoindre, N'hésitez pas à poser votre candidature et nous trouverons des opportunités de bénévolat au sein de notre équipe en fonction de vos compétences et de vos désirs. Avez-vous des idées pour améliorer l'Ukraine? Apportez-les à la vie avec nous! Vous avez besoin du soutien à l’immigration pour vivre en Ukraine? Nous le fournissons à tous nos volontaires étrangers. Vous avez encore des questions ? N'hésitez pas et remplissez notre formulaire de demande. Parlons de votre futur voyage bénévole dans le cadre de l'équipe Anomaly!"]},"Anomaly supports animal shelters in Kyiv, Lviv, and Dnipro. We help volunteers to solve the problem of stray animal overpopulation.":{msgstr:["Anomaly soutient les abris pour animaux à Kyiv, Lviv, Dnipro. Nous aidons les bénévoles à résoudre le problème de la surpopulation animale perdue."]},"Anomaly works with Kyiv City Administration and local community leaders to help solve everyday problems of Kyiv residents, such as utility outages, road potholes, and piling rubbish.":{msgstr:["Anomalie collabore avec l'administration de la ville de Kiev et les dirigeants de la communauté locale afin d'aider à résoudre les problèmes quotidiens des habitants de Kiev comme les pannes d'utilité, les nids-de-poule des routes et l'accumulation de déchets."]},"Anti - Narc":{msgstr:["Anti-- Narc"]},"Are you or a loved one a veteran who would like to help make Ukraine a better place? If so, join our volunteer team today!":{msgstr:["Êtes-vous, ou l'un de vos proches, un ancien vétéran qui aimerait contribuer à faire de l'Ukraine un endroit meilleur ? Si oui, rejoignez notre équipe de bénévoles dès aujourd'hui !"]},"Become a Volunteer":{msgstr:["Devenir un bénévole"]},"Check out our accomplishments":{msgstr:["Découvrez nos accomplissements"]},"Children of ATO Veterans":{msgstr:["Enfants d'ATO vétérans"]},"Children of Crimea and Tatars":{msgstr:["Enfants de Crimée et de Tatars"]},"Children of Donbas":{msgstr:["Enfants de Donbas"]},"Come grab a drink with us! We offer a cool environment to meet with other veterns like yourself.":{msgstr:["Venez prendre un verre avec nous! Nous offrons un environnement cool pour rencontrer d'autres vétérans comme vous."]},Community:{msgstr:["Communauté"]},Competency:{msgstr:["Compétence"]},"Contact us":{msgstr:["Contactez-nous"]},Contacts:{msgstr:["Contacts"]},Creativity:{msgstr:["Créativité"]},"Crimean Tatars and IDP Children":{msgstr:["Tatars de Crimée et enfants IDP"]},"Dare to do the impossible!":{msgstr:["Osez faire l'impossible!"]},"David Plaster":{msgstr:["David Plaster"]},'David\'s favorite way to describe himself is as a "mere pensioner." After retiring from his career as a US Army medic, David came to Ukraine in 2011 and shortly thereafter decided to build a life here. He served with other volunteers as a combat medic both on the Maidan and at the front in Donbas, and he has been working to make Ukraine a better place in every way he can ever since. He founded Anomaly as an organizational vehicle for that vision on Maidan December 1st, 2013 and officially in 2016 as a Ukrainian NGO.':{msgstr:["La façon préférée de David pour se décrire est d'être un \"simple retraité\". Après avoir pris sa retraite de sa carrière de médecin de l'armée américaine, David est arrivé en Ukraine en 2011 et a décidé peu après de construire sa vie ici. Il a servi avec d'autres volontaires en tant qu'infirmier de combat à la fois sur le Maidan et sur le front de Donbas, et depuis, il s'efforce de faire de l'Ukraine un endroit meilleur de toutes les manières possibles. Il a fondé Anomaly comme un véhicule organisationnel pour cette vision sur Maidan le 1er décembre 2013 et officiellement en 2016 comme une ONG ukrainienne."]},"Developed leadership courses for women where they are typically underrepresented; police, military, science (STEM), led by female professionals in the top of their fields to share expertise and train course attendees in state-of-the-science business methods and career progression skills.":{msgstr:["Développer des cours de leadership pour les femmes où elles sont généralement sous-représentées ; police, militaire, science (STEM), mené par des professionnelles de haut niveau dans leurs domaines pour partager leur expertise et former les participantes à des méthodes commerciales à la pointe de la science en matière de progression de carrière."]},"Developing community activism":{msgstr:["Développement de l'activisme communautaire"]},Diaspora:{msgstr:["Diaspora"]},"Do you have an idea that would help to improve civil society in Ukraine? Let us know!":{msgstr:["Avez-vous une idée qui aiderait à améliorer la société civile en Ukraine? Faites-nous savoir!"]},"Do you have something that you want to teach to others? Come join us!":{msgstr:["Avez-vous quelque chose que vous voulez enseigner aux autres? Venez nous rejoindre!"]},"Do you want to make Ukraine green again? Join our team and make our home a cleaner, greener place for generations to come!":{msgstr:["Rejoignez notre équipe et faites de notre maison un lieu plus propre et plus écologique pour les générations à venir!"]},"Don't drink? It's okay - have something non-alcoholic! :) The important thing that we don't drink alone!":{msgstr:["Vous ne buvez pas ? C'est ok - avez quelque chose de non-alcoolisé! :) L'important que nous ne buvons pas seuls!"]},"Drinkin' Bros is an international veterans organization and we run the Ukrainian chapter.":{msgstr:["Drinkin' Bros est une organisation internationale de vétérans et nous gérons le chapitre ukrainien."]},"E - democracy":{msgstr:["E - démocratie"]},Ecology:{msgstr:["Écologie"]},Education:{msgstr:["Éducation"]},Email:{msgstr:["Courriel"]},English:{msgstr:["Anglais"]},'Every heard of the saying "it takes a village to raise a child"? It\'s true! Help kids who have family members in the military by joining our mentorship program.':{msgstr:["Tout le monde a entendu parler du dicton \"il faut un village pour élever un enfant\"? C'est vrai! Aidez les enfants qui ont des membres de la famille dans l'armée en participant à notre programme de mentorat."]},"Everyday Crimean Tartar families are being separated by Russian forces. Imagine losing your father at such a young age. It's all very confusing but mentoring can help!":{msgstr:["Chaque jour, les familles de Tartars de Crimée sont séparées par les forces russes. Imaginez que vous perdiez votre père à un âge si jeune. Tout cela est très déroutant, mais le mentorat peut aider !"]},"Founder & Chairman":{msgstr:["Fondateur & Président"]},Gallery:{msgstr:["Galerie"]},Growth:{msgstr:["Croissance"]},"Have experience working with animals or animal rights? Come join us!":{msgstr:["Vous avez de l'expérience dans le domaine des animaux ou des droits des animaux ? Venez nous rejoindre !"]},"Have experience working with kids? Come show us!":{msgstr:["Vous avez de l'expérience avec les enfants ? Venez nous montrer !"]},"Help advocate for animal rights and protect street animals.":{msgstr:["Aider à défendre les droits des animaux et à protéger les animaux de rue."]},"Help advocate for better living situtations in orphanges.":{msgstr:["Aider à promouvoir de meilleures conditions de vie dans les orphelinats."]},"Help transform how society views stray dogs and help get them homes! Foster a pup today!":{msgstr:["Aidez à transformer les vues de la société sur les chiens errants et aidez-les à les ramener à la maison! Renforcez un chiot aujourd'hui!"]},Home:{msgstr:["Page d'accueil"]},"Housing Authority":{msgstr:["Office du logement"]},Integrity:{msgstr:["Intégrité"]},"It seems everyday that there's a new narcotics telegram channel graffitied around the neighborhood. We totally get it! To combat this, Anomaly organised local teams to clean up their neighborhoods. Want to know how? Click the box below (can be a highlight of this bot's success compared to the MVS) we work together with our eco team while we are cleaning up the neighborhoods we show people how to reduce drug use in their communities; reference the \"broken window theory\" how cleaner neighborhoods can help to reduce drug use (focus is on the drug issues and community activism development then e democracy meaning showing the locations how to more easily communicate with local admin., city workers, police, and politicians":{msgstr:["Il semble tous les jours qu'il y ait un nouveau canal de télégramme de narcotique graffitié autour du voisinage. On comprend totalement! Pour combattre cela, Anomaly a organisé des équipes locales pour nettoyer leurs quartiers. Vous voulez savoir comment ? Cliquez sur la case ci-dessous (peut être un point culminant du succès de ce bot par rapport à la MVS). Nous travaillons avec notre éco équipe pendant que nous nettoyons les quartiers où nous montrons aux gens comment réduire la consommation de drogues dans leurs communautés ; faire référence à la « théorie de la fenêtre brisée » comment des quartiers plus propres peuvent aider à réduire la consommation de drogues (l'accent est mis sur les problèmes de drogue et le développement de l'activisme communautaire puis la démocratie qui signifie montrer les lieux comment communiquer plus facilement avec l'administrateur local. ouvriers de la ville, policiers et politiciens"]},"Join Anomaly Today!":{msgstr:["Rejoignez Anomalie aujourd'hui!"]},Kids:{msgstr:["Enfants"]},Leadership:{msgstr:["Leadership"]},"Leadership courses":{msgstr:["Cours de Leadership"]},"LoveUA is a Ukrainian ecology platform made of an association of ecology groups and activists to track and solve eco problems in Ukraine":{msgstr:["LoveUA est une plate-forme d'écologie ukrainienne composée d'une association de groupes d'écologie et de militants pour suivre et résoudre les problèmes d'écologie en Ukraine"]},"Military Medicine":{msgstr:["Médecine Militaire"]},"Miltary medical training":{msgstr:["Formation médicale militaire"]},"Offered courses in SMM, videography, and PR communications to government departments, young business entrepenuers and veterans to help them get their work into the public conversation.":{msgstr:["Cours proposés en SMM, en vidéographie et en communication de RP aux ministères, aux jeunes entrepreneurs et vétérans pour les aider à mettre leur travail dans le débat public."]},Orphans:{msgstr:["Orphelins"]},"Our founder":{msgstr:["Notre fondateur"]},"Our projects":{msgstr:["Nos projets"]},"Our team":{msgstr:["Notre équipe"]},Phone:{msgstr:["Téléphone"]},Playgrounds:{msgstr:["Aire de jeux"]},Projects:{msgstr:["Projets"]},Social:{msgstr:["Sociale"]},"Social Media Marketing":{msgstr:["Marketing sur médias sociaux"]},"Social Media Marketing training":{msgstr:["Formation en marketing des médias sociaux"]},"Social Support":{msgstr:["Aide sociale"]},"Support for Ukrainian veterans: Every Sunday we offer free English courses and conversation clubs specifically for veterans, ATO volunteers, and their families in Kyiv.":{msgstr:["Soutien aux vétérans ukrainiens : Chaque dimanche nous offrons des cours d'anglais et des clubs de conversation gratuits pour les vétérans, les bénévoles de l'ATO et leurs familles à Kiev."]},"Supported by multiple nations":{msgstr:["Soutenu par plusieurs nations"]},Sustainability:{msgstr:["Développement durable"]},"Today our team includes hundreds of volunteers from more than 12 countries and all over Ukraine. Like billions of drops make an ocean, each of our team members makes their contribution in making Ukraine better.":{msgstr:["Aujourd'hui, notre équipe compte des centaines de bénévoles de plus de 12 pays et de toute l'Ukraine. Comme des milliards de gouttes font un océan, chaque membre de notre équipe contribue à améliorer l’Ukraine."]},"Trained over 8000 military, volunteers, and national guardsmen in NATO miltary medical standards. In addition to individual training, Anomaly assisted the National Guard of Ukraine in programmatic development of a NATO-standard medic course, implemented on an organization-wide level.":{msgstr:["Formation de plus de 8000 militaires, volontaires et membres de la garde nationale aux normes médicales militaires de l'OTAN. En plus de la formation individuelle, Anomaly a aidé la Garde nationale ukrainienne à élaborer un programme de formation médicale aux normes de l'OTAN, mis en œuvre à l'échelle de l'organisation."]},"Ukraine has a large diaspora population which has made homes all over the world, especially in Canada, the United States, and Poland. Since the Revolution of Dignity in 2014, many diaspora have felt called to make a difference.":{msgstr:["L'Ukraine compte une importante population de diaspora qui a fait des foyers partout dans le monde, en particulier au Canada, aux États-Unis et en Pologne. Depuis la Révolution de la dignité en 2014, de nombreuses diaspora se sont senties appelées à faire la différence."]},"Velyka Vasylkivska st, 72, office 20,\nUkraine, 03150, Kyiv":{msgstr:["Velyka Vasylkivska, 72, bureau 20,\nUkraine, 03150, Kiev"]},"Velyka Vasylkivska st, 72, office 20, Ukraine, 03150, Kyiv":{msgstr:["Velyka Vasylkivska, 72, bureau 20, Ukraine, 03150, Kiev"]},Veterans:{msgstr:["Les vétérans"]},"Volunteering opportunities":{msgstr:["Opportunités de bénévolat"]},"We also help to connect vets with caretakers, social workers, and psychological support.":{msgstr:["Nous aidons également à mettre les vétérans en contact avec des soignants, des travailleurs sociaux et un soutien psychologique."]},"We are always looking for volunteers to help us solve this problem. If you think that is you, then join us today!.":{msgstr:["Nous sommes toujours à la recherche de bénévoles pour nous aider à résoudre ce problème. Si vous pensez que c'est vous, alors rejoignez-nous dès aujourd'hui!."]},"We are the largest group of eco activitists in Ukraine":{msgstr:["Nous sommes le plus grand groupe d’éco-actifs en Ukraine"]},"We conducted more than 55 clean ups in 2019-20":{msgstr:["Nous avons procédé à plus de 55 nettoyages en 2019-2020"]},"We have organized a network of 1000+ veteran care specialists from all over the country to help assist veterans with their transition to civilian life and recovery after returning from war.":{msgstr:["Nous avons organisé un réseau de plus de 1000 spécialistes de soins vétérans de partout au pays pour aider les vétérans à passer à la vie civile et à la récupération après leur retour de la guerre."]},"We help children of veterans, returned Russian-held political prisoners, Crimean Tatar exiles, and IDPs to attend our free English lessons and speaking clubs.":{msgstr:["Nous aidons les enfants des anciens combattants, des prisonniers politiques de retour de Russie, des exilés tatars de Crimée et des personnes déplacées à l'intérieur du pays à suivre nos cours d'anglais gratuits et à participer à nos clubs d'expression orale."]},"We make it easy for Kyivans to improve their communities with just their thumbs and an internet connection!":{msgstr:["Nous rendons facile pour les Kyivans d’améliorer leurs communautés avec leurs pouces et une connexion Internet!"]},"We organize regular volunteer outings (our tolokas) and social events (Drinkin’ Bros Ukraine) to connect members of the veteran community with each other, their fellow citizens, as well as officials and visitors from local government and embassies.":{msgstr:["Nous organisons régulièrement des sorties bénévoles (nos tolokas) et des événements sociaux (Drinkin’ Bros Ukraine) mettre en relation les membres de la communauté des anciens combattants entre eux, leurs concitoyens, ainsi que les fonctionnaires et les visiteurs du gouvernement local et des ambassades."]},"We organized English-language conversation and craft sessions for younger children of IDPs, ATO veterans, and Crimean Tatars in Kyiv, as well as English conversation clubs for teenaged children of those groups":{msgstr:["Nous avons organisé des conversations en anglais et des sessions de bricolage pour les jeunes enfants de PDI, vétérans de l'OAT, et Tatars de Crimée à Kyiv, ainsi que des clubs de conversation anglais pour les enfants adolescents de ces groupes"]},"We support faster problem solving with local governance by providing reporting tools for the 100,000 residents of the most underserved areas of Kyiv, directly connecting them with local utility service providers.":{msgstr:["Nous soutenons une résolution plus rapide des problèmes avec la gouvernance locale en fournissant des outils de reporting pour les 100, 000 résidents des zones les plus défavorisées de Kyiv, qui les relient directement aux fournisseurs de services publics locaux."]},"We won first prize in Ukraine and second prize in the world in the 2018 Enactus Award competition":{msgstr:["Nous avons remporté le premier prix en Ukraine et le deuxième prix dans le monde lors de la compétition du prix Enactus 2018"]},"We work with the local community policing department to protect the rights of children in Kyiv.":{msgstr:["Nous travaillons avec le service de police de la communauté locale pour protéger les droits des enfants à Kyiv."]},Welcome:{msgstr:["Bienvenu(e)"]},"What is the Ukrainian Diaspora?":{msgstr:["Qu'est-ce que la diaspora ukrainienne ?"]},"With our ‘Dbayemo Razom’ project, we connected 1,000+ mental health professionals, 10,000+ trained peer counselors and 3 physical rehabilitation centers. The network shares experience, expertise, and resources to better serve people in Ukraine.":{msgstr:["Grâce à notre projet ‘Dbayemo Razom’, nous avons relié plus de 1 000 professionnels de la santé mentale, plus de 10 000 conseillers qualifiés et 3 centres de réadaptation physique. Le réseau partage son expérience, son expertise et ses ressources pour mieux servir les personnes en Ukraine."]},"With the war in Eastern Ukraine continuing on, children and families are being separated and forced to leave their homes.":{msgstr:["Avec la poursuite de la guerre en Ukraine orientale, les enfants et les familles sont séparés et forcés de quitter leurs maisons."]}}}}}}]);
